  namespace: SuperOffice.CRM.Services
  summary: "\nCarrier object for SuggestedDocumentEntity.\nServices for the SuggestedDocumentEntity Carrier is available from the <xref href=\"SuperOffice.CRM.Services.IDocumentAgent\" data-throw-if-not-resolved=\"false\"></xref>.\n"
  example:
  - "\nGet SuggestedDocumentEntity 123 using the agent:\n<pre><code> using SuperOffice;\n using SuperOffice.CRM.Services;\n\n using (SoSession mySession = SoSession.Authenticate(&quot;user&quot;, &quot;pass&quot;))\n {\n    var agent = new DocumentAgent();\n    var suggestedDocumentEntity = agent.GetSuggestedDocumentEntity( 123 );\n }</code></pre>\n"
  syntax:
    content: 'public class SuggestedDocumentEntity : Carrier'
    content.vb: >-
      Public Class SuggestedDocumentEntity

          Inherits Carrier
